INSERT INTO `course` VALUES (26,'Master spécialisé en Sciences Géospatiales et Gouvernance foncière (SGGF)','<ul><li><div>CONDITIONS D’ACCES</div><div>Prérequis académiques :</div><div>Les candidats issus des parcours Licence, Master ou Ingénieur sont éligibles et peuvent</div><div>déposer leurs dossiers dans les conditions ci-dessous :</div><div> Licence nationale en Mathématique et/ou Informatique et/ ou Physique ou diplôme</div><div>reconnu équivalent issu des facultés des sciences ou sciences et techniques,</div><div> Licence professionnelle nationale en Géomatique, Géoscience, Géo-informatique,</div><div>Urbanisme et aménagement du Territoire ou diplôme reconnu équivalent issu des</div><div>établissements de l’enseignement supérieur,</div><div> Licence nationale en sciences économiques ou gestion, en géographie, ou en droit</div><div>assortie d\'un diplôme de baccalauréat national en sciences mathématiques, physiques</div><div>chimies ou Sciences de la vie et de la terre,</div><div> Ingénieur ou Master en : Sciences Géomatiques et Ingénierie Topographique,</div><div>Géoinformation, Sciences Géographiques, Génie Rural, Agroéconomie, Génie Civil, ou</div><div>tout diplôme reconnu équivalent.</div><div><br></div><div>SELECTION DES ADMIS :</div><div>- Les candidats admissibles seront invités à un test oral.</div><div>- Les candidats admis suite au test oral seront invités pour compléter leurs inscriptions.</div><div>- Les candidats de la liste d\'attente peuvent être invités selon la disponibilité des postes.</div><div>- Les cours démarreront le 20 septembre 2022.</div><div>FRAIS DU DOSSIER :</div><div>- Frais de dossier de 300,00 Dhs versés&nbsp; au compte de l’ENAM Hassan II ouvert à la Trésorerie Générale du Royaume sous le N° 310 810 100002400 40187</div><div>SELECTION DES ADMISSIBLES :<br></div><div>Tous les candidats doivent soumettre en ligne leurs dossiers composés des éléments</div><div>suivants :</div><div>- Copie conforme du diplôme ou certificat. L’originale du diplôme ou du certificat est</div><div>exigée pour tous les candidats retenus,</div><div>- Copies certifiées conformes des relevés des notes des cycles des formations</div><div>poursuivies,</div><div>- Le nombre d’années exigé pour une licence est de 3 ans et pour un cycle ingénieur ou</div><div>master est de 5 ans,</div><div>- Les candidats issus d’une Licence doivent avoir des mentions assez bien tout au long</div><div>de leurs parcours et les candidats ingénieur ou master doivent avoir au minimum 3</div><div>mentions assez bien,</div><div>- Une note 12.00/20 par semestre ou par année est équivalente à la mention Assez Bien,</div><div>- Une expérience professionnelle d’une année est équivalente à une mention assez bien,</div><div>- La date limite du dépôt électronique des dossiers est le 05 septembre 2022,</div><div>- La liste des candidats admissibles sera publiée sur le site de l’ENAM Hassan II.</div><div>Prérequis linguistiques :</div><div>Certains modules peuvent être délivrés en anglais. Un niveau « intermediate» comme</div><div>minimum requis en langue anglaise est exigé pour les étudiants dont la langue d’études</div><div>est autre que l’Anglais. Pour les candidats issus des pays anglosaxons, il est exigé d’avoir</div><div>un niveau intermédiaire au minimum en Français pour pouvoir suivre les modules</div>enseignés en français.</li></ul>',2022,'2022-09-05 00:00:00','2022-09-12 00:00:00','2022-09-05 00:00:00'),(27,'Sciences Géomatiques et Ingénierie Topographique','Dans\r\nla limite des places disponibles, l\'Institut Agronomique et Vétérinaire Hassan\r\nII organise un concours pour l\'accès en 1ère Année Cycle Ingénieur, Filières :\r\nSciences Géomatiques-Ingénierie Topographique et Génie Rural. Ce concours est\r\nouvert aux candidats remplissant les conditions ci-dessous :\r\n\r\n<span><b>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Conditions :</u></b></span>\r\n\r\nü&nbsp; Titulaires des\r\ndiplômes suivants&nbsp;: DEUG, DEUST (maths, informatique, physique), Licence\r\n(maths, informatique, physique), Diplôme de technicien en topographie ou\r\ntechnicien en Génie Rural (bac+2).\r\n\r\nü&nbsp; Avoir obtenu des\r\nmentions Bien durant la scolarité.\r\n\r\n&nbsp;\r\n\r\n<span><b>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Compétence recherchée :</u></b></span>\r\n\r\nü&nbsp; Formation :\r\n(Mathématiques, physique, informatique, statistiques et français)\r\n\r\nü&nbsp; Connaissances\r\ndans les domaines liés à la filière choisie (Topographie ou Génie Rural).\r\n\r\n&nbsp;\r\n\r\n<span><b>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Dossier de candidature :</u></b></span>\r\n\r\nü&nbsp; Une demande\r\nmanuscrite adressée à Monsieur le Directeur de l’ENAM Hassan II, précisant le\r\nchoix de la filière (Topographie ou Génie Rural) ;\r\n\r\nü&nbsp; Copie certifiée\r\nconforme du Baccalauréat (recto-verso) ;\r\n\r\nü&nbsp; Copies\r\ncertifiées conformes des notes obtenues après le Baccalauréat ;\r\n\r\nü&nbsp; Copie certifiée\r\nconforme du diplôme obtenu après le Baccalauréat ;\r\n\r\nü&nbsp; Un C.V.\r\nprécisant les coordonnées du candidat (adresse, N° de téléphone, e-mail) ;\r\n\r\nü&nbsp; Copie légalisée\r\nde la CIN ;\r\n\r\nü&nbsp; Reçu du virement\r\nde 240,00 DHS pour les frais d\'étude du dossier, versés au compte de l’ENAM Hassan\r\nII ouvert à la Trésorerie Générale du Royaume sous le N° 310 810 100002400\r\n40187.\r\n\r\n&nbsp;\r\n\r\n<span><b>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Date de soumission des dossiers :</u></b></span>\r\n\r\n<span>ü&nbsp; <i>Jeudi 30 juin\r\n2022 </i>: Dernier délai\r\nde réception des dossiers sur la plateforme de l’ENAM Hassan II.</span>\r\n\r\n&nbsp;\r\n\r\n<span><b>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</b><b><u>Modalités de sélection&nbsp;</u></b><span>: Etude de dossier, test et entretien\r\n<b><u></u></b></span></span>',2022,'2022-06-30 00:00:00','2022-07-15 00:00:00','2022-06-30 00:00:00');
/*!40000 ALTER TABLE `course` ENABLE KEYS */;
