INSERT INTO `school_field` VALUES (40,'Sciences et Technologies de l\'Espace : \"Systèmes Mondiaux de Navigation par Satellites\" (GNSS)','2020-01-01 00:00:00','test'),(41,'Master en Modélisation et Management des projets BIM','2020-01-01 00:00:00','Master en Modélisation et Management des projets BIM'),(42,'Sciences Géospatiales et Gouvernance Foncière (SGGF)','2021-09-10 00:00:00','Conditions d\'accès:<br><ul><li>Licence nationale en Mathématique et/ou Informatique et/ ou Physique ou diplôme reconnu équivalent</li><li>Licence professionnelle nationale accréditée en Géomatique, Géoscience, Géo-informatique, Urbanisme et aménagement du Territoire ou diplôme reconnu équivalent.</li><li>Licence nationale en sciences économiques ou gestion, en géographie, ou en droit assortie d\'un diplôme de baccalauréat national en sciences mathématiques, physique &amp; chimie ou Sciences de la vie et de la terre.</li><li>Ingénieur ou Master en : Sciences Géomatiques et Ingénierie Topographique, Géo-information, Sciences Géographiques, Génie Rural, Agroéconomie, Génie Civil, ou tout diplôme reconnu équivalent.</li><li>Conditions Prérequis linguistiques&nbsp;: Certains modules seront enseignés en anglais. Un niveau « intermédiate » comme minimum requis en langue anglaise est exigé pour les étudiants algériens, marocains, mauritaniens et tunisiens. Pour les candidats des pays Egypte et Soudan, il est exigé d’avoir un niveau intermédiaire au minimum en Français pour pouvoir suivre les modules enseignés en français.</li></ul><ul><li>NB&nbsp;: Les candidats issus d’un parcours Licence doivent justifier des mentions assez bien au minimum tout au long de leurs parcours,</li><li>Les candidats issus du parcours ingénieur ou master doivent justifier au minimum 3 mentions assez bien tout au long de leurs parcours,</li></ul><br><br>Dossier de candidature ( à scanner et à soumettre en ligne du 17 septembre&nbsp;&nbsp;au 04 octobre 2021 à 23h59:<br><ul><li>Une demande manuscrite adressée à M. le Directeur de l\'ENAM Hassan II ;</li><li>Copie certifiée conforme du Baccalauréat (recto-verso) ;</li><li>Copie certifiée conforme des diplômes obtenus après le Baccalauréat ;</li><li>Copies certifiées conformes des notes obtenues après le Baccalauréat ;</li><li>Copie de la CIN ;</li><li>Paiement en ligne sur le compte de l\'ENAM&nbsp;&nbsp;ouvert à la Trésorerie Générale du Royaume, compte bancaire : RIB&nbsp;:&nbsp; 310 810 10000 2400 40187 0145&nbsp; &nbsp;ou fournir le reçu du paiement des frais d\'étude du dossier&nbsp;: (300,00 DHS, Non remboursables), versés sur le même compte de l’ENAM&nbsp;</li></ul>');
